import imageUrl from "../public/static/images/wajari-tone.png";
import { NextSeo } from 'next-seo'; 
export const meta = {
  title: "Wajari Velásquez's Web Development, React, JavaScript and SEO blog",
  tags: ["React"],
  layout: "post",
  publishDate: "2020-05-04",
  modifiedDate: false,
  seoDescription: "Web Development blog in React. Especially interested in Next.js, Node, SEO, linux. A personal project of Wajari Velásquez"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <NextSeo title="Wajari Velásquez's Web Development, React, JavaScript and SEO blog" description="Web Development blog in React. Especially interested in Next.js, Node, SEO, linux. A personal project of Wajari Velásquez" canonical="https://wajari.dev/" mdxType="NextSeo" />
    <h1>{`Wajari.dev`}</h1>
    <h2>{`Padawan FullStack JavaScript | React | SEO Consultant`}</h2>
    <p>{`Podcaster, blogger, SEO workshops, I help to organize open source technology communities from #WordPress and #SEO.`}</p>
    <p>{`Currently training in JavaScript, React, Node.js, Git.`}</p>
    <p>{`This is my `}<strong parentName="p">{`blog`}</strong>{` focused on Web Development, Linux, Technical SEO and personal thoughts.`}</p>
    <p>{`I did it with love in React, Next.js and markdown.`}</p>
    <img src={imageUrl} className="img-centered" alt="Wajari Velasquez" />
    <p>{`If you want to know more about me, I have different contact websites (all resources in Spanish):`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://wajari.com"
        }}>{`Wajari`}</a></li>
      <li parentName="ul">{`One `}<a parentName="li" {...{
          "href": "https://seoparawp.com"
        }}>{`podcast`}</a>{` of SEO for WordPress`}</li>
      <li parentName="ul">{`A `}<a parentName="li" {...{
          "href": "https://ku-seo.com"
        }}>{`SEO consulting`}</a></li>
    </ul>
    </MDXLayout>;
}

